import styled from "styled-components";

export const Wrap = styled.div`
  max-height: 700px;
  position: relative;
`;

export const Text = styled.div`
position: absolute;
top: 20%;
    left: 75%;
    width: 40%;
transform: translate(-50%, -50%);
font-size: 21px;
color: white;
`;
